const LysLapskaus = (props) => {

    const [showResults, setShowResults] = useState(false);
    const onClick = () => {
        const newResult = showResults === 'false' ? 'true' : 'false';
        props.changeDiv(newResult);
        setShowResults(true);
    }

    const [energi, setEnergi] = useState();
    const changeHandle = (event) => {
        setEnergi(event.target.value)
    }

    return (
        <div>
            <h5>Porsjon (gram)  100</h5>

            <div class="bg-light">

                <form>
                    <div class="form-group row">
                        <label class="col-sm-2 col-form-label">Energi</label>
                        <div class="col-sm-4">
                            <input type="text" class="form-control" onChange={changeHandle} value={energi}/>
                        </div>
                    </div>
                </form>

            </div>

            <div class="col-12 button-div">
                <button type="submit" class="btn btn-primary btn-lg button-search" onClick={onClick}>SÃ¸k</button>
            </div>
        </div>

    )
};

